prompt: "Q: Write python code to solve the following coding problem that obeys the\
  \ constraints and passes the example test cases. The output code needs to read from\
  \ and write to standard IO. Please wrap your code answer using ```:\nKoa the Koala\
  \ and her best friend want to play a game.\n\nThe game starts with an array a of\
  \ length n consisting of non-negative integers. Koa and her best friend move in\
  \ turns and each have initially a score equal to 0. Koa starts.\n\nLet's describe\
  \ a move in the game:\n\n  * During his move, a player chooses any element of the\
  \ array and removes it from this array, xor-ing it with the current score of the\
  \ player.\n\nMore formally: if the current score of the player is x and the chosen\
  \ element is y, his new score will be x \u2295 y. Here \u2295 denotes [bitwise XOR\
  \ operation](https://en.wikipedia.org/wiki/Bitwise_operation#XOR).\n\nNote that\
  \ after a move element y is removed from a.\n\n  * The game ends when the array\
  \ is empty. \n\n\n\nAt the end of the game the winner is the player with the maximum\
  \ score. If both players have the same score then it's a draw.\n\nIf both players\
  \ play optimally find out whether Koa will win, lose or draw the game.\n\nInput\n\
  \nEach test contains multiple test cases. The first line contains t (1 \u2264 t\
  \ \u2264 10^4) \u2014 the number of test cases. Description of the test cases follows.\n\
  \nThe first line of each test case contains the integer n (1 \u2264 n \u2264 10^5)\
  \ \u2014 the length of a.\n\nThe second line of each test case contains n integers\
  \ a_1, a_2, \u2026, a_n (0 \u2264 a_i \u2264 10^9) \u2014 elements of a.\n\nIt is\
  \ guaranteed that the sum of n over all test cases does not exceed 10^5.\n\nOutput\n\
  \nFor each test case print:\n\n  * WIN if Koa will win the game. \n  * LOSE if Koa\
  \ will lose the game. \n  * DRAW if the game ends in a draw. \n\nExamples\n\nInput\n\
  \n\n3\n3\n1 2 2\n3\n2 2 3\n5\n0 0 0 2 2\n\n\nOutput\n\n\nWIN\nLOSE\nDRAW\n\n\nInput\n\
  \n\n4\n5\n4 1 5 1 3\n4\n1 0 1 6\n1\n0\n2\n5 4\n\n\nOutput\n\n\nWIN\nWIN\nDRAW\n\
  WIN\n\nNote\n\nIn testcase 1 of the first sample we have:\n\na = [1, 2, 2]. Here\
  \ Koa chooses 1, other player has to choose 2, Koa chooses another 2. Score for\
  \ Koa is 1 \u2295 2 = 3 and score for other player is 2 so Koa wins.\nA: ```import\
  \ sys\n\ninput=sys.stdin.readline\n\nfor _ in range(int(input())):\n    n=int(input())\n\
  \    a=list(map(int,input().split()))\n    base=0\n    for A in a:\n        base^=A\n\
  \    if base==0:\n        print(\"DRAW\")\n    else:\n        m=base.bit_length()-1\n\
  \        count=0\n        for A in a:\n            count+=(A>>m &1==1)\n       \
  \ if n%2==1:\n            if count%4==1:\n                print(\"WIN\")\n     \
  \       else:\n                print(\"LOSE\")\n        else:\n            print(\"\
  WIN\")```\nQ: Write python code to solve the following coding problem that obeys\
  \ the constraints and passes the example test cases. The output code needs to read\
  \ from and write to standard IO. Please wrap your code answer using ```:\nYou have\
  \ decided to give an allowance to your child depending on the outcome of the game\
  \ that he will play now.\n\nThe game is played as follows:\n\n* There are three\
  \ \"integer panels\", each with a digit between 1 and 9 (inclusive) printed on it,\
  \ and one \"operator panel\" with a `+` printed on it.\n* The player should construct\
  \ a formula of the form X + Y, by arranging the four panels from left to right.\
  \ (The operator panel should not be placed at either end of the formula.)\n* Then,\
  \ the amount of the allowance will be equal to the resulting value of the formula.\n\
  \n\n\nGiven the values A, B and C printed on the integer panels used in the game,\
  \ find the maximum possible amount of the allowance.\n\nConstraints\n\n* All values\
