  \ Standard Input in the following format:\n\n\nA B C\n\n\nOutput\n\nPrint the maximum\
  \ possible amount of the allowance.\n\nExamples\n\nInput\n\n1 5 2\n\n\nOutput\n\n\
  53\n\n\nInput\n\n9 9 9\n\n\nOutput\n\n108\n\n\nInput\n\n6 6 7\n\n\nOutput\n\n82\n\
